import React from 'react'

const MainPage  = ({ information }) => {
    if(information === null){
        return (
            <div></div>

        )
    }
    return (

        <div className = "MainPage">
            {information.data.data.map((match) => (<h3>{match["score"]}</h3>) 
            
            )}
        </div>
    )

}


export default MainPage
